  void _onClickHistoryBtn() {
    Navigator.push(
        context,
        MaterialPageRoute(
            builder: (BuildContext context) => EcgHistoryScreen(widget._user)));
  }

  void _onClickTakeECGBtn() {
    Navigator.push(
        context,
        MaterialPageRoute(
            // builder: (BuildContext context) => const FileSelectionScreen()));
            builder: (BuildContext context) =>
                ElectrodePlacementInstructionsScreen(widget._user)));
  }

  void _onTapTempBtn() async {
    try {
      File ecgFile = await _saveLeadsToFile();
      Navigator.push(
        context,
        MaterialPageRoute(
          builder: (BuildContext context) => ECGDiagnosisScreen(file: ecgFile, user: widget._user),
        ),
      );
    } catch (e) {
      print("Error saving ECG data to file: $e");
      // Optionally, show an error message to the user
    }
  }


  Future<File> _saveLeadsToFile() async {
    Map<String, List<double>> ecgData = {
      'l1': _ecgDataLead1,
      'l2': _ecgDataLead2,
      'l3': _ecgDataLead3,
      'avr': _ecgDataLeadAvr,
      'avl': _ecgDataLeadAvl,
      'avf': _ecgDataLeadAvf,
      'v1': _ecgDataLeadV1,
      'v2': _ecgDataLeadV2,
      'v3': _ecgDataLeadV3,
      'v4': _ecgDataLeadV4,
      'v5': _ecgDataLeadV5,
      'v6': _ecgDataLeadV6,
    };

    String jsonString = jsonEncode(ecgData);

    Directory directory = await getApplicationDocumentsDirectory();
    String filePath = '${directory.path}/ecg_data.txt';
    File file = File(filePath);

    return file.writeAsString(jsonString);
  }


